import React from "react";
import Contacts from '../contacts';

function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <div className="card">
        <div className="top">
          <h2>{Contacts.name}</h2>
          <img
            src={Contacts.imgURL}
            alt="avatar_img"
          />
        </div>
        <div className="bottom">
          <p>{Contacts.phone}</p>
          <p>{Contacts.email}</p>
        </div>
      </div>
    </div>
  );
}

export default App;
